import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';

ReactDOM.render(
  <React.StrictMode>
   <div className="App">
      <div>
        <div>基础hook</div>
        <div>
          <Link to='./basic/useState.js'>useState</Link>
          <Link to='./basic/useEffect.js'>useEffect</Link>
          <Link to='./basic/useContext.js'>useContext</Link>
        </div>
      </div>
      <div>
        <div>额外的hook</div>
        <div>
          <Link to='./extra/useReducer.js'>useReducer</Link>
          <Link to='./extra/useCallback.js'>useCallback</Link>
          <Link to='./extra/useMemo.js'>useMemo</Link>
          <Link to='./extra/useRef.js'>useRef</Link>
          <Link to='./extra/useImperativeHandle.js'>useImperativeHandle</Link>
          <Link to='./extra/useLayoutEffect.js'>useLayoutEffect</Link>
          <Link to='./extra/useDebugValue.js'>useDebugValue</Link>
        </div>
      </div>
    </div>
  </React.StrictMode>,
  document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
